  const currentScore = score;
  let courseResults = [];
  const recommendationList = courseResults.map((result, index) => (
    <p key={index}>{result}</p>
  ));
  console.log(recommendationList);

  return (
    <>
      <MyContext.Consumer>
        {({ course, media }) => {
          return (
            <p>
              {course}
              {media}
            </p>
          );
        }}
      </MyContext.Consumer>
    </>
  );
}
